INSERT INTO foodIntrod (food_id, origin, introduction) VALUES
(1, '美國', '漢堡是美國的經典快餐，由肉餅、起司、生菜、醬料等食材組成。'),
(2, '義大利', '義大利麵是一種源自義大利的麵食，通常使用麵條配以各種醬料，如番茄醬、奶油醬或海鮮醬。'),
(3, '意大利', '披薩起源於意大利，是一種以麵團為底，配以番茄醬、起司和其他配料的烤製食物。'),
(4, '希臘', '凱撒沙拉是一道希臘風味的沙拉，主要食材包括生菜、希臘乳酪、鷹嘴豆、酸豆等。'),
(5, '美國', '三明治是一種源自美國的三層麵包夾心食物，內含肉類、蔬菜、醬料等。');